INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130011, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 1, 3001100, 2.1, 3001, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 100, "ヤマト", 2);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130011, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 4, 3001101, 5.68, 3001, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 101, "ヤマト", 2);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130011, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 3001102, 0.0, 3001, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 102, "ヤマト", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 3002100, 0.0, 3002, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 100, "フブキ", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 3002101, 0.0, 3002, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 101, "フブキ", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 5, 3002102, 8.53, 3002, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 102, "フブキ", 2);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 7, 3002103, 5.67, 3002, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 103, "フブキ", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 3002104, 0.0, 3002, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 104, "フブキ", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 3002300, 0.0, 3004, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 300, "フブキ", 3);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 3002400, 0.0, 3005, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 301, "フブキ", 7);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 2, 3003200, 4.4, 3003, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 200, "フブキ", 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 3003201, 0.0, 3003, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 201, "フブキ", 7);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (130211, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 1, 3003202, 5.6, 3003, "2030/01/01 14:59:59", 0.0, -416.5, "2024/10/31 12:00:00", 202, "フブキ", 2);
